INSERT INTO `projects` VALUES ('07c86b0d-d800-428f-b80c-0d3c28355e05','20130224',_binary '\0',NULL,'2025-08-03 07:09:48.166614',NULL,'2025-08-03 07:09:48.166614','20130224','Xây dựng website để tìm kiếm, đăng ký và mua vé cho các sự kiện, hội thảo, workshop. Có tính năng quản lý sự kiện cho ban tổ chức.','Nền Tảng Đặt Vé Sự Kiện/Hội Thảo'),('1026a2df-a7d4-4361-9508-2e2f2d003a39','21130279',_binary '\0',NULL,'2025-08-03 07:09:47.801530',NULL,'2025-08-03 07:09:47.801530','21130279','Tạo một thị trường online cho các sản phẩm thủ công, đồ tự làm (DIY). Tập trung vào cộng đồng người bán và người mua, và các tùy chỉnh sản phẩm.','Website Đồ Handmade & DIY'),('1472acd0-631c-48bb-8996-18307df6c002','21130363',_binary '\0',NULL,'2025-08-03 07:09:47.457677',NULL,'2025-08-03 07:09:47.457677','21130363','Xây dựng hệ thống cho phép người dùng đặt đồ ăn từ các nhà hàng đối tác, bao gồm chọn món, giỏ hàng, thanh toán và theo dõi đơn hàng.','Nền Tảng Đặt Đồ Ăn Online'),('253ac332-b8e2-43a7-bbc7-d673ddabc733','20130224',_binary '\0',NULL,'2025-07-29 17:42:16.875980',NULL,'2025-07-29 17:42:16.875980','20130224','Xây dựng website để tìm kiếm, đăng ký và mua vé cho các sự kiện, hội thảo, workshop. Có tính năng quản lý sự kiện cho ban tổ chức.','Nền Tảng Đặt Vé Sự Kiện/Hội Thảo'),('3438c873-bc50-42c4-a598-1ed31761fe23','21130451',_binary '\0',NULL,'2025-07-29 17:42:15.649931',NULL,'2025-07-29 17:42:15.649931','21130451','Phát triển nền tảng thương mại điện tử chuyên về sách, có thể bao gồm quản lý danh mục, tìm kiếm nâng cao, đánh giá sản phẩm và đề xuất cá nhân hóa.','Cửa Hàng Sách Trực Tuyến'),('3614906c-31d7-46d3-a1c7-a7e4bd9c6d16','21130359',_binary '\0',NULL,'2025-08-03 07:09:48.354957',NULL,'2025-08-03 07:09:48.354957','21130359','Tạo cửa hàng trực tuyến chuyên về trang phục, giày dép và dụng cụ thể thao. Bao gồm bộ lọc theo môn thể thao, thương hiệu, và kích cỡ.','Website Bán Đồ Thể Thao & Dụng Cụ'),('3ef85d80-2e30-40e1-b1cc-e942989e23bc','21130320',_binary '\0',NULL,'2025-08-03